import React from "react";
import { Nav } from "react-bootstrap";
import { SidebarMenu, SidebarMenuBody } from "react-bootstrap-sidebar-menu";
import "./index.css";
const Bar = (props) => {
  return (
    <>
      <SidebarMenu.Header>
        <SidebarMenu.Brand>{/* Your brand icon */}</SidebarMenu.Brand>
        <SidebarMenu.Toggle />
      </SidebarMenu.Header>
      <SidebarMenuBody>
        <SidebarMenu.Nav>
          <SidebarMenu.Nav.Link>
            <SidebarMenu.Nav.Icon>{/* Menu item icon */}</SidebarMenu.Nav.Icon>
            <SidebarMenu.Nav.Title>
              {/* Menu item title */}
            </SidebarMenu.Nav.Title>
          </SidebarMenu.Nav.Link>
        </SidebarMenu.Nav>
        <SidebarMenu.Nav />

        <SidebarMenu.Sub>
          <SidebarMenu.Sub.Toggle>
            <SidebarMenu.Nav.Icon />
            <SidebarMenu.Nav.Title>{/* Submenu title */}</SidebarMenu.Nav.Title>
          </SidebarMenu.Sub.Toggle>
          <SidebarMenu.Sub.Collapse>
            <SidebarMenu.Nav>
              <SidebarMenu.Nav.Link>
                <SidebarMenu.Nav.Icon>
                  {/* Submenu item icon */}
                </SidebarMenu.Nav.Icon>
                <SidebarMenu.Nav.Title>
                  {/* Submenu item title */}
                </SidebarMenu.Nav.Title>
              </SidebarMenu.Nav.Link>
            </SidebarMenu.Nav>
          </SidebarMenu.Sub.Collapse>
        </SidebarMenu.Sub>
      </SidebarMenuBody>
    </>
  );
};
// const Sidebar = withRouter(Side);

export default Bar;
